산과 해태바위 등 폭포와 아름다운 계곡들이 있다. 수덕사가 자리하고 있는 곳이다. 수덕사 대웅전은 부석사 무량수전, 안동 봉정사 극락전등과 함께 현존하는 고려시대 목조건물이다. 대웅전은 1936년부터 4년동안 절을 고치다가 대들보에서 나온 묵서(墨書)에서 고려 충렬왕 34년(1308년) 건립되었다는 사실을 확인했다. 국보인 대웅전은 남아있는 고려시대 건축물 가운데 특이하게 백제적인 곡선을 보여주고 있다. 앞 세칸 곁 네칸의 단층 맞배집으로 그 형태가 장중하다. 덕산도립공원은 1990년 11월 1일 부터는 취사행위가 전면 금지되었다. * 덕숭산지구 - 수덕사, 환희대, 견성암, 금강암, 정혜사, 소림초당, 만공탑, 일주문, 여승당 등 * 가야산지구 - 가야사지, 옥계저수지, 남연군묘, 상황사지, 보덕사, 쉬흔길바위, 옥양폭포, 거북바위, 고려자기묘지 ※ 주요문화재 수덕사대웅전(국보), 수덕사 대불, 3층석탑, 7층석탑, 육괴정, 만공선사 사리탑, 황하루, 성보박물관'),(6,'admin','asd1','asd1',6,'2023-05-25 06:42:52','',126160,'동화사(대구)','대구광역시 동구 동화사1길 1','대구 도심에서 동북쪽으로 22km 떨어진 팔공산 남쪽 기슭에 신라 소지왕 15년(493년)에 극달화상이 세운 절로, 그때 이름은 유가사였으나, 흥덕왕 7년(832년)에 심지왕사가 다시 세울 때 겨울철인데도 경내에 오동나무가 활짝 피었다고 해서 동화사라 이름을 고쳐 불렀다고 한다. 절 입구는 수목이 우거져 있고 사철 맑은 물이 폭포를 이루며 흐른다. 지금의 대웅전은 1727년에 중건한 것이며 염불암을 비롯하여 6개의 암자를 거느리고 있다. 대웅전 앞 누각에 ');
